import React from 'react'
import Precart from './Precart/Precart';
import ProductsCart from './ProductsCart/ProductsCart';
import s from './Cart.module.css'

export default function Cart({cart_products}) {
  return (
    <div className={s.cart_elements}>
      {/* <h1 className={['h2', 'bg-white dark:bg-black'].join(' ')}>Shopping cart</h1> */}
      <h1 className='h2'>Shopping cart</h1>

      <div className='flex mb-10'>
        <Precart cart_products={cart_products} />
        <ProductsCart />
      </div>
  </div>
  )
}
